import React from 'react';
import FooterComponent from '../Footer/footer';

class ViewListing extends React.Component {
    constructor(props) {
        super(props);

    }


    render(){
        return (
        <div>
            <div className="Address">
            <li>Address</li>
            {this.props.listing.address.addressLine1} , {this.props.listing.address.addressLine2}
            <br></br>
            <b>City :</b>{this.props.listing.address.city}
            <br></br>
            <b>State :</b>{this.props.listing.address.state}
            <br></br>
            <b>Zipcode :</b>{this.props.listing.address.zipCode}
            <br></br>

            </div>
           <b>Leaseterm :</b>{this.props.listing.listingType}
            <br></br>
            <b>Roomtype : </b>{this.props.listing.roomType}
            <br></br>
            <b>RoomDescription :</b> {this.props.listing.totalNoOfBedrooms} bhk and {this.props.listing.totalNoOfBathrooms} bath and {this.props.listing.AboutNeighborhood}
            <br></br>
            <b>inUnitWasher : </b>{this.props.listing.Amenities.inUnitWasher ? 'Yes' : 'No'} 
            <br></br>
            <b>AC : </b>{this.props.listing.Amenities.AC ? 'Yes' : 'No'} 
            <br></br>
            <b>TV : </b>{this.props.listing.Amenities.TV ? 'Yes' : 'No'}
            <br></br> 
           <b> Wi-fi : </b>{this.props.listing.Amenities.wifiIncluded ? 'Yes' : 'No'}
            <br></br>
            Private Bathroom : {this.props.listing.Amenities.privateBathroom ? 'Yes' : 'No'}
            <br></br>
            Elevator : {this.props.listing.Amenities.Elevator ? 'Yes' : 'No'}
            <br></br>
            Preferred Gender : {this.props.listing.preferredGender}
            <br></br>
            Roomate Preferences : {this.props.listing.roommateRules.noDrinking ? 'No Drinking' : 'No Preference'}, {this.props.listing.roommateRules.noSmoking ? 'No Smoking' : 'No Preference'}
            <br></br>
            {this.props.listing.roommateRules.noPets ? 'Sorry, Pets are Allowed' : 'Pet Friendly'}
            <br></br>
            About Roomate : {this.props.listing.roommateDescription} 
            <br></br>
            Contact Name : {this.props.listing.hostInformation.name}
            <br></br>
            Phone : {this.props.listing.hostInformation.phone}

            <FooterComponent />
        </div>

        )





        }

    }

export default ViewListing;
